import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link, useParams } from "react-router-dom";
import spacex from "../../Image/spacex1.jpeg";
const SingleLaunch = () => {
  const [launchs, setLaunchs] = useState([]);
  const { id } = useParams();
  useEffect(() => {
    axios
      .get(`https://api.spacexdata.com/v4/launches/${id}`)
      .then((response) => {
        console.log(response.data);
        setLaunchs(response.data);
      });
  }, [id]);
  return (
    <div>
      <div className="container text-light" style={{ marginTop: "90px" }}>
        <div className="row">
            <div className="col-sm-6">
        <h1>
          <small className="text-muted">{launchs.name}</small>
        </h1>
        <h4>
          Auto Upadate :
          <small className="text-light">
            {launchs.auto_update === true ? "true" : null}
          </small>
        </h4>

          <div className="col-sm-6">
            <p>Type : {}</p>
            <p>Crew : {}</p>
            <p>Dray Mass :{}kg</p>
            {/* <p className={props.active === true ? "text-success" : "text-danger"}>
            {props.active === true ? "active" : null}
          </p> */}
            {/* <p>Return Payload Mass: {props.return_payload_mass} kg</p> */}
            <a href = {launchs.links===undefined?"hello":launchs.links.article} type="button" className="btn btn-outline-light btn-md">
              wikipedia
            </a>
          </div>
          <div className="col-sm-6">
            <p className="h6">Heat sheild deatil</p>
            <p>Materail:{}</p>
            <p>size : {}m</p>
            <p>Temprature:{} degree</p>
            <p>Dev partner : {}</p>
            <div>
              <h6>Other Deatil:</h6>
              <p>Launch Payload Mass : {}</p>
              <p>Presssurize Capsule Payload Volume : {} meter cube</p>
            </div>
          </div>
        </div>
        {/* <div className="row"> */}
        <div className="col-sm-6">
          <img src = {launchs.links===undefined ?{spacex}:launchs.links.patch.large}className="img-fluid"  alt="..."/>
          <h1>hello this is our page spacex </h1>
        </div>
        {/* </div> */}
        <div>
          <p calssName="h7 text-start">{}</p>
        </div>
        </div>
      </div>
    </div>
  );
};

export default SingleLaunch;
